import React from "react";
import styled from "styled-components";
import Row from "react-bootstrap/Row";
import Col from "react-bootstrap/Col";
import { ReactComponent as HeroImage } from "../assets/heroVector.svg";
import heroImage from "../assets/heroImage.png";

const LandingPage = () => {
  return (
    <StyledHeroSection>
      <div className="hero-container">
        <Row>
          <Col xs={12} md={8}>
            <h1>Testing 123 lorem ipsum dolor amet lorem ipsum dolor</h1>
          </Col>
          <Col xs={12} md={4}>
            <div className="image-wrap">
              {/* <HeroImage /> */}
              <img src={heroImage} />
            </div>
          </Col>
        </Row>
      </div>
    </StyledHeroSection>
  );
};

export default LandingPage;

const StyledHeroSection = styled.div`
  position: relative;
  overflow: hidden;
  padding-top: 96px;
  padding-bottom: 96px;

  .col-md-8 {
    min-height: 464px;
    display: flex;
    align-items: center;
  }
  .col-md-4 {
    min-height: 464px;
    display: flex;
    align-items: center;
  }

  .hero-container {
    z-index: 9998;
    width: 100%;
    max-width: 1256px;
    margin-right: auto;
    margin-left: auto;
    padding-right: 20px;
    padding-left: 20px;
  }

  .image-wrap {
    position: absolute;
    overflow: hidden;
    width: 1022px;
    height: 440px;

    @media (max-width: 767px) {
      position: static;
      width: auto;
      height: auto;
      margin-top: 32px;
    }
  }

  img {
    position: absolute;
    left: 48px;
    top: 0;
    right: 0;
    bottom: 0;
    display: block;
    height: 100%;
    -o-object-fit: cover;
    object-fit: cover;

    @media (max-width: 767px) {
      position: static;
      width: 100%;
    }
  }
`;
